import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const More = () => {
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <View style={styles.backArrow}></View>
      </View>
      <View style={styles.profile}>
        <Image
          source={require('../img/your-profile-picture.png')}
          style={styles.profilePic}
        />
        <View>
          <Text style={styles.name}>Hammad Zaib</Text>
        </View>
      </View>
      <View style={styles.menu}>
        <View style={styles.menuItem}>
          <Image
            source={require('../img/p.png')}
            style={styles.menuItemIcon}
          />
          <Text style={styles.menuItemText}>Profile</Text>
          <Image
            source={require('../img/right-arrow.png')}
            style={styles.rightArrow}
          />
        </View>
        <View style={styles.menuItem}>
          <Image
            source={require('../img/p.png')}
            style={styles.menuItemIcon}
          />
          <Text style={styles.menuItemText}>Orders</Text>
          <Image
            source={require('../img/right-arrow.png')}
            style={styles.rightArrow}
          />
        </View>
        <View style={styles.menuItem}>
          <Image
            source={require('../img/p.png')}
            style={styles.menuItemIcon}
          />
          <Text style={styles.menuItemText}>Contact Us</Text>
          <Image
            source={require('../img/right-arrow.png')}
            style={styles.rightArrow}
          />
        </View>
        <View style={styles.menuItem}>
          <Image
            source={require('../img/p.png')}
            style={styles.menuItemIcon}
          />
          <Text style={styles.menuItemText}>About Us</Text>
          <Image
            source={require('../img/right-arrow.png')}
            style={styles.rightArrow}
          />
        </View>
        <View style={styles.menuItem}>
          <Image
            source={require('../img/p.png')}
            style={styles.menuItemIcon}
          />
          <Text style={styles.menuItemText}>Return and Exchange</Text>
          <Image
            source={require('../img/right-arrow.png')}
            style={styles.rightArrow}
          />
        </View>
        <View style={styles.menuItem}>
          <Image
            source={require('../img/p.png')}
            style={styles.menuItemIcon}
          />
          <Text style={styles.menuItemText}>Logout</Text>
          <Image
            source={require('../img/right-arrow.png')}
            style={styles.rightArrow}
          />
        </View>
      </View>
      <View style={styles.footer}>
        <View style={styles.footerIcon}></View>
        <View style={styles.footerIcon}></View>
        <View style={styles.footerIcon}></View>
        <View style={[styles.footerIcon, styles.spaceBetweenIcons]}></View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#f2f2f2',
    padding: 20,
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 20,
  },
  backArrow: {
    width: 20,
    height: 20,
    backgroundColor: '#fff',
  },
  profile: {
    flexDirection: 'row',
    alignItems: 'center',
    marginTop: 20,
    marginBottom: 100,
  },
  profilePic: {
    width: 80,
    height: 80,
    borderRadius: 50,
    marginRight: 10,
  },
  name: {
    fontSize: 18,
    fontWeight: 'bold',
  },
  menu: {
    marginBottom: '100%',
  },
  menuItem: {
    flexDirection: 'row',
    alignItems: 'center',
    marginBottom: 40,
    backgroundColor: '#fff',
    padding: 10,
  },
  menuItemIcon: {
    width: 20,
    height: 20,
    marginRight: 10,
    backgroundColor: '#fff',
  },
  menuItemText: {
    fontSize: 16,
  },
  rightArrow: {
    width: 10,
    height: 10,
    marginLeft: 'auto',
    backgroundColor: '#fff',
  },
  footer: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginTop: 20,
    backgroundColor: '#fff',
    padding: 10,
  },
  footerIcon: {
    width: 30,
    height: 30,
    marginRight: 10,
    backgroundColor: '#fff',
    resizeMode: 'cover',
  },
});

export default More;
